INSERT INTO `recruit_info` VALUES (1,3,'3600-4600',' 徐家汇 ',NULL,'公司保洁员/商场保洁员','保洁',0,7,'工作时间：7:30-17:30\n 工作内容：\n 1.负责公司旗舰体验中心日常保洁工作，保持指定区域干净整洁；\n 2.帮忙打扫咖啡吧区域卫生，协助收拾整理会议室等；\n 3.合理使用和放置保洁用具；\n 4.其他上级领导安排的保洁相关事宜。\n 职位要求：\n 1.年龄在45岁左右，商场保洁员经验2年以上；\n 2.按照公司标准要求穿着服装；\n 3.爱干净，勤快，有服务意识，无不良嗜好；\n 4.普通话无明显口音。\n 工作时间：7:30-16:30','不限','不限','  广告     五险一金    ',''),(2,4,'4000-6000',' 马陆 ',NULL,'高薪诚聘外贸业务员','外贸专员/助理',0,5,'应届毕业生优先\n岗位职责：\n1、 能够独立开展贸易业务，开发新客户，定期回访老客户，优化客户资源；\n2、 负责公司主营产品的推广及销售；\n3、 负责联系客户、编制报价、参与商务谈判；\n4、 负责单证审核、结算、售后服务等工作；\n5、 业务相关资料的整理和归档；\n6、 领导分派的其他相关工作\n任职资格：\n1、大专及以上学历，国际贸易，英语四级以上，较好是刚毕业的应届生；\n2、熟悉贸易操作流程及相关法律法规，具备贸易领域专业知识；\n3、具有良好的业务拓展能力和商务谈判技巧，公关意识强，具有较强的事业心、团队合作精神和独立处事能力，勇于开拓和创新。','不限','大专','     包吃   交通补助   饭补   包住    ',NULL),(3,82,'4500-8000',' 松江 ',NULL,'服务员包吃住4500起','服务员',0,5,NULL,'不限','不限','     包吃   包住   年底双薪   五险一金    ',NULL),(4,397,'4000-7000',' 中山 ',NULL,'高薪汽车美容技师','汽车美容',1,1,NULL,'不限','不限','     包吃   房补    ',NULL),(5,741,'11000-15000',' 上海 ',NULL,'急招C1驾驶员。','商务司机',0,4,NULL,'不限','不限','     交通补助   年底双薪    ',NULL),(6,511,'15000-23000',' 松江老城 ',NULL,'全都是年轻人在奋斗的工作','房产经纪人',0,4,'描述不重要，有兴趣的话主要靠谈出来的！\n销售是普通人通往成功的较短的捷径！销售的较本质的就是沟通和谈判，有兴趣做销售，来，我们当面谈！\n诚聘：对现状不满，不干平庸，想超越自己的你。\n年龄18---32岁，身体健康，吃苦耐劳。\n1：薪资标准：无责任底薪3000-6000，加提成30%---60%；带薪培训。\n2：工作条件：带客户看房、签单、走售后流程。\n3: 福利待遇。 每个月均有重磅激励方案（季度游、奖品、现金）。\n4:透明的晋升机会，靠自己能力晋升管理者，基层管理者平均月薪12000以上，晋升不封顶，工资不封顶。都是年轻人的舞台！\n20多岁的年纪，别把激情给了是人都能做的工作，态度决定你一生的。','不限','不限','     五险一金   话补   交通补助   饭补   房补         ',NULL),(7,331,'6000-7000',' 徐汇 ',NULL,'电气自动化技术+应届生','自动化工程师',0,2,'岗位职责：\n1、负责自动化系统方案设计，施工图和加工制造图纸设计；\n2、负责各种测量仪表和自动控制系统、电气仪表备件的选型及管理；\n3、负责维护检修生产装置的各种仪表，各种计量仪表的检测；\n4、负责扩建和技改项目，包括仪表桥架的设计安装、电缆的铺设、气源管线和引压管线的安装，仪表的安装调试，控制回路的信号测试；\n5、负责对自控系统及仪表图纸进行设计、选型、安装、调试和维护等工作，对温度、压力、流量、液位实现自动化控制等。\n任职资格：\n1、大学本科以上学历，工业自动化专业；\n2、应届毕业生；\n3、熟练掌握办公自动化软件的使用和操作以及一款3D建模软件，如ProE，3DMax等；\n4、英语读写良好。','不限','本科','     周末双休    ',NULL),(8,123,'8000-15000',' 人民广场 ',NULL,'饿了么站点直招外卖小哥哥','送餐员',1,6,'岗位职责：\n1、负责自动化系统方案设计，施工图和加工制造图纸设计；\n2、负责各种测量仪表和自动控制系统、电气仪表